import React, { Component } from 'react'; 
import "../App.css";
import Stocktable from './stocktable';

class Highest extends Component {
    render(){
        return(
            <div>
            <div className = "What_s_trending_" >Highest Gainers
            </div>
            <Stocktable />
            </div>
        );
    }
}

export default Highest;
